import React, { useState, useEffect } from 'react';
import { scrollToElement } from '../utils/scrollUtils';

const Hero = () => {
  const [displayText, setDisplayText] = useState('');
  const [currentIndex, setCurrentIndex] = useState(0);
  const [isDeleting, setIsDeleting] = useState(false);
  
  const titles = [
    'Full Stack Developer',
    'React Specialist',
    'UI/UX Enthusiast',
    'Problem Solver'
  ];

  useEffect(() => {
    const currentTitle = titles[currentIndex];
    const timeout = setTimeout(() => {
      if (!isDeleting) {
        if (displayText.length < currentTitle.length) {
          setDisplayText(currentTitle.slice(0, displayText.length + 1));
        } else {
          setTimeout(() => setIsDeleting(true), 2000);
        }
      } else {
        if (displayText.length > 0) {
          setDisplayText(displayText.slice(0, -1));
        } else {
          setIsDeleting(false);
          setCurrentIndex((prev) => (prev + 1) % titles.length);
        }
      }
    }, isDeleting ? 50 : 100);

    return () => clearTimeout(timeout);
  }, [displayText, currentIndex, isDeleting, titles]);

  return (
    <section id="home" className="min-h-screen flex items-center justify-center bg-gradient-to-br from-blue-50 to-indigo-100 relative overflow-hidden">
      {/* Floating background elements */}
      <div className="absolute inset-0 overflow-hidden">
        <div className="absolute top-20 left-10 w-20 h-20 bg-blue-200/30 rounded-full animate-float"></div>
        <div className="absolute top-40 right-20 w-16 h-16 bg-purple-200/30 rounded-full animate-float animate-delay-500"></div>
        <div className="absolute bottom-32 left-1/4 w-12 h-12 bg-indigo-200/30 rounded-full animate-float animate-delay-1000"></div>
        <div className="absolute bottom-20 right-1/3 w-24 h-24 bg-blue-300/20 rounded-full animate-float animate-delay-700"></div>
      </div>
      
      <div className="container-max section-padding text-center relative z-10">
        <div className="animate-fade-in-up">
          <div className="mb-8 relative">
            <div className="relative inline-block">
              <img
                src="https://via.placeholder.com/200x200/4F46E5/FFFFFF?text=Photo"
                alt="Profile"
                className="w-32 h-32 md:w-40 md:h-40 rounded-full mx-auto mb-6 shadow-xl hover-lift animate-bounce-in"
              />
              <div className="pulse-ring"></div>
            </div>
          </div>
          
          <h1 className="text-4xl md:text-6xl lg:text-7xl font-bold text-gray-900 mb-6 animate-fade-in-down animate-delay-200">
            Hi, I'm <span className="gradient-text animate-text-glow">[Your Name]</span>
          </h1>
          
          <p className="text-xl md:text-2xl text-gray-600 mb-8 max-w-3xl mx-auto animate-fade-in-up animate-delay-300">
            A passionate <span className="font-semibold text-gray-800 inline-block min-w-[200px] typewriter-cursor">
              {displayText}
              <span className="animate-pulse">|</span>
            </span>
            <br />
            creating amazing digital experiences with modern technologies
          </p>
          
          <div className="flex flex-col sm:flex-row gap-4 justify-center items-center animate-fade-in-up animate-delay-500">
            <button 
              onClick={() => scrollToElement('projects')}
              className="btn-primary animate-bounce-in-up animate-delay-700"
            >
              View My Work
            </button>
            <button 
              onClick={() => scrollToElement('contact')}
              className="btn-secondary animate-bounce-in-up animate-delay-1000"
            >
              Get In Touch
            </button>
          </div>
          
          <div className="mt-12 animate-bounce-slow animate-delay-1000">
            <button 
              onClick={() => scrollToElement('about')}
              className="text-gray-400 hover:text-gray-600 transition-all duration-300 hover:scale-110 hover:animate-wiggle"
            >
              <svg className="w-6 h-6 mx-auto" fill="none" stroke="currentColor" viewBox="0 0 24 24">
                <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M19 14l-7 7m0 0l-7-7m7 7V3" />
              </svg>
            </button>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Hero;
